import React from 'react';
import { MDBInput,MDBFormInline } from 'mdbreact';

class Footer extends React.Component {
    render() {

        return (
            <div>
      {/* Material inline */}
      <MDBFormInline>
        <MDBInput label="1" type="checkbox" id="checkbox1" />
        <MDBInput label="2" type="checkbox" id="checkbox2" />
        <MDBInput label="3" type="checkbox" id="checkbox3" />
      </MDBFormInline>
      <div>
      {/* Filled-in unchecked */}
      <MDBInput label="Filled-in unchecked" filled type="checkbox" id="checkbox1" />

      {/* Filled-in checked */}
      <MDBInput label="Filled-in unchecked" filled checked type="checkbox" id="checkbox2" />

      {/* Filled-in unchecked disabled */}
      <MDBInput label="Filled-in unchecked" filled disabled type="checkbox" id="checkbox3" />

      {/* Filled-in checked disabled */}
      <MDBInput label="Filled-in unchecked" filled checked disabled type="checkbox" id="checkbox4" />
    </div>
    </div>
        )
    }
}


export default Footer
